import React from 'react';
import '../components/App.css'
import Profile from '.'

const ProfileReview = ({ profileReviews }) =>
    <div className="app">
       <div className="profile" >
      {(profileReviews || []).map(x =>
          <Profile 
        key ={x.objectId}
          review={x}
          />
      )}
    </div>
    </div>

  export default ProfileReview;
